n, CloudFlare Integration & more.'=>'Тест продуктивності, Оптимізація файлів та стиснення, Кешування сторінок, браузера та Gravatar, Стиснення GZIP, Інтеграція CloudFlare та інше.','Hummingbird Page Speed Optimization'=>'Hummingbird Оптимізація Швидкості Сайту','Smush'=>'Smush','Smush Pro'=>'Smush Pro','Security Tweaks & Recommendations, File & Malware Scanning, Login & 404 Lockout Protection, Two-Factor Authentication & more.'=>'Налаштування безпеки та рекомендації, Сканування файлів та шкідливого коду, Захист Входу та 404, Двох-факторна аутентифікація та інше.','Defender Security, Monitoring, and Hack Protection'=>'Defender Безпека, Моніторинг ти Захист Злому','Check out our other free wordpress.org plugins!'=>'Спробуйте решту наших безкоштовних плагінів на wordpress.org!','Smush uses a third-party email service (Drip) to send informational emails to the site administrator. The administrator\'s email address is sent to Drip and a cookie is set by the service. Only administrator information is collected by Drip.'=>'Smush використовує сторонню службу електронної пошти (Drip) щоб надсилати інформаційні листи адміністратору. E-mail адреса адміністратора надсилається до Drip і ця служба встановлює cookie. Drip збирає лише дані адміністратора.','Smush sends images to the WPMU DEV servers to optimize them for web use. This includes the transfer of EXIF data. The EXIF data will either be stripped or returned as it is. It is not stored on the WPMU DEV servers.'=>'Smush надсилає зображення до серверів WPMU DEV, щоб оптимізувати їх для використання на сайті. Це включає передачу EXIF даних. EXIF дані будуть видалені або повернуті у початковому вигляді. Вони не зберігаються на серверах WPMU DEV.','Note: Smush does not interact with end users on your website. The only input option Smush has is to a newsletter subscription for site admins only. If you would like to notify your users of this in your privacy policy, you can use the information below.'=>'Примітка: Smush не взаємодіє з кінцевими користувачами вашого веб-сайту. Єдина функція вводу, яку має Smush - це підписка на новини лише для адміністраторів сайту. Якщо ви бажаєте повідомити своїх користувачів про це у політиці конфіденційності, ви можете використати інформацію наведену нижче.','Plugin: Smush'=>'Плагін: Smush','Click to start Bulk Smushing images in Media Library'=>'Натискайте щоб розпочати Масову Оптимізацію зображень в Медіа Бібліотеці','GET STARTED'=>'РОЗПОЧАТИ','Select a directory you\'d like to Smush.'=>'Оберіть директорію яку ви бажаєте оптимізувати.','Smush Stats'=>'Статистика Оптимізації','Give us a moment while we sync the stats.'=>'Дайте нам хвилинку, поки ми синхронізуємо дані статистики.','Note: For this process to happen automatically you need automatic smushing enabled.'=>'Примітка: Щоб це процес відбувався автоматично, Вам потрібно ввімкнути автоматичну оптимізацію.','Smush will automatically check for any images that need re-smushing.'=>'Smush автоматично перевіряє наявність будь-яких зображень, які потребують повторної оптимізації.','Stop current bulk smush process.'=>'Зупинити поточний процес масової оптимізації.','PNG to JPEG savings'=>'Економія на конвертації PNG в JPEG','Total savings'=>'Загальна економія','Images Resized'=>'Зображень зменшено','Images smushed'=>'Зображень оптимізовано','Amazon S3 support is active.'=>'Підтримка Amazon S3 активована.','Amazon S3'=>'Amazon S3','Enable Amazon S3 support'=>'Увімкнути підтримку Amazon S3','NextGen Gallery'=>'NextGen Галерея','Choose directory'=>'Оберіть директорію','Smush images that aren\'t located in your uploads folder.'=>'Оптимізуйте зображення що знаходяться поза директорією для завантажень.','Directory Smush Savings'=>'Економія завдяки оптимізації дерикторій','PNG to JPEG Conversion'=>'Конвертація PNG в JPEG','Auto-convert PNGs to JPEGs (lossy)'=>'Автоматична конвертація PNG в JPEG (зі зменшенням розміру файлів)','When you compress a PNG, Smush will check if converting it to JPEG could further reduce it